/* ln(lux) approx in Q format (Q8.8 stored as uint16) */
static inline uint16_t tfm_ln_lux_q(uint16_t lux)
{
    if (lux == 0u) return 0u;
    uint16_t i = (uint16_t)(lux >> (16u - TFM_LUT_BITS));
    uint16_t f = (uint16_t)(lux & (TFM_LUT_STEP - 1u));
    if (i >= TFM_LUT_N) return tfm_ln_lut_q[TFM_LUT_N];
    uint16_t y0 = tfm_ln_lut_q[i];
    uint16_t y1 = tfm_ln_lut_q[i + 1u];
    uint16_t dy = (uint16_t)(y1 - y0);
    return (uint16_t)(y0 + (uint16_t)((dy * f) / TFM_LUT_STEP));
}

/* ln(1+lux) approx in Q format */
static inline uint16_t tfm_ln1p_lux_q(uint16_t lux)
{
    uint32_t x = (uint32_t)lux + 1u;
    if (x > 65535u) x = 65535u;
    return tfm_ln_lux_q((uint16_t)x);
}

/* float32_t helpers */
static inline float32_t tfm_ln_lux_f(uint16_t lux)
{
    return ((float32_t)tfm_ln_lux_q(lux)) / (float32_t)TFM_LN_Q_SCALE;
}

static inline float32_t tfm_ln1p_lux_f(uint16_t lux)
{
    return ((float32_t)tfm_ln1p_lux_q(lux)) / (float32_t)TFM_LN_Q_SCALE;
}

